import * as actionTypes from '../action/actionTypes';

const initialState = {
    account: {
        email: '',
        id: -1,
        logged_in: false,
        name: '',
        password: ''
    },
}

const reducer = (state = initialState, action) => {
    switch(action.type) {
        case actionTypes.LOGIN_SUCCESS:
            action.behavior();
            break;

        case actionTypes.LOGIN_FAILED:
            action.behavior();
            break;

        default:
            break;
    }
    console.log(state);
    return state;
}

export default reducer;
